var BlocklyGamesMsg={"Games.name":"Παιχνίδια Blockly","Games.pondTutor":"Εκπαιδευτής Λίμνης","Games.pond":"Λίμνη","Games.linesOfCode1":"Λύσατε αυτό το επίπεδο με 1 γραμμή JavaScript:","Games.linesOfCode2":"Λύσατε αυτό το επίπεδο με %1 γραμμές JavaScript:","Games.nextLevel":"Είστε έτοιμοι για το επίπεδο %1;","Games.finalLevel":"Είστε έτοιμοι για την επόμενη πρόκληση;","Games.linkTooltip":"Αποθήκευσε και συνέδεσε στα μπλοκ.","Games.runTooltip":"Εκτέλεσε το πρόγραμμα που έγραψες.","Games.runProgram":"Εκτέλεση Προγράμματος","Games.resetTooltip":"Διακοπή του προγράμματος και επαναφορά του επιπέδου.","Games.resetProgram":"Επαναφορά","Games.help":"Βοήθεια","Games.catLogic":"Λογική","Games.catLoops":"Επαναλήψεις","Games.catMath":"Μαθηματικά","Games.httpRequestError":"Υπήρξε πρόβλημα με το αίτημα.","Games.linkAlert":"Κοινοποίησε τα μπλοκ σου με αυτόν τον σύνδεσμο:\n\n%1","Games.hashError":"Λυπάμαι, το '%1' δεν αντιστοιχεί σε κανένα αποθηκευμένο πρόγραμμα.","Games.congratulations":"Συγχαρητήρια!","Pond.scanTooltip":"Έλεγξε για εχθρούς. Δώσε μια διεύθυνση (0-360). Επιστρέφει την απόσταση στον πλησιέστερο εχθρό σε αυτήν την διεύθυνση. Επιστρέφει Άπειρο αν δεν βρέθηκε εχθρός.","Pond.cannonTooltip":"Πυροβόλησε με το κανόνι. Καθόρισε μια κατεύθυνση (0-360) και μια απόσταση (0-70).","Pond.swimTooltip":"Κολύμπησε προς τα εμπρός. Καθόρισε μια κατεύθυνση (0-360).","Pond.stopTooltip":"Σταμάτα το κολύμπι. Ο παίκτης θα επιβραδύνει για να σταματήσει.","Pond.healthTooltip":"Επιστρέφει την τρέχουσα υγεία του παίκτη (0 είναι νεκρός, 100 είναι υγιής).","Pond.speedTooltip":"Επιστρέφει την τρέχουσα ταχύτητα κίνησης του παίκτη (0 σταματημένος, 100 με πλήρη ταχύτητα).","Pond.locXTooltip":"Επιστρέφει η θέση X του παίκτη (το 0 είναι το αριστερό άκρο, 100 είναι το δεξί άκρο).","Pond.locYTooltip":"Επιστρέφει την θέση Υ του παίκτη (0 είναι το κάτω άκρο, 100 είναι το επάνω άκρο).","Pond.logTooltip":"Εμφανίζει ένα αριθμό στην κονσόλα του περιηγητή σας.","Pond.docsTooltip":"Εμφάνιση της τεκμηρίωσης της γλώσσας.","Pond.documentation":"Τεκμηρίωση","Pond.playerName":"Παίκτης","Pond.targetName":"Στόχος","Pond.pendulumName":"Εκκρεμές","Pond.scaredName":"Φοβισμένος","Pond.helpUseScan":"Η λύση σου δουλεύει, αλλά μπορείς να την βελτιώσεις. Χρησιμοποίησε το 'scan' για να ορίσεις την απόσταση βολής του κανονιού.","Pond.helpText1":"Χρησιμοποίησε την εντολή 'cannon' για να χτυπήσεις τον στόχο. Η πρώτη παράμετρος είναι η γωνία, η δεύτερη είναι η απόσταση. Βρες τον σωστό συνδυασμό.","Pond.helpText2":"Πρέπει να χτυπήσεις αυτόν τον στόχο πολλές φορές. Χρησιμοποίησε την επανάληψη 'while (true)' για να εκτελέσετε πολλές φορές.","Pond.helpText3a":"Αυτός ο αντίπαλος κινείτε μπροστά και πίσω και έτσι είναι δύσκολο να πετύχετε τον στόχο. Η συνάρτηση 'scan' επιστρέφει την ακριβή απόσταση από τον αντίπαλο στην δοσμένη κατεύθυνση.","Pond.helpText3b":"Αυτή η απόσταση είναι ακριβώς αυτή που χρειάζεται η εντολή 'cannon' για να πυροβολήσει με ακρίβεια.","Pond.helpText4":"Αυτός ο αντίπαλος είναι πολύ μακριά για να χρησιμοποιήσεις το κανόνι (που έχει ένα όριο 70 μέτρων). Αντιθέτως, χρησιμοποίησε την εντολή 'swim' για να αρχίσει να κολυμπά προς τον αντίπαλο και να τον χτυπήσει.","Pond.helpText5":"Αυτός ο αντίπαλος είναι επίσης πολύ μακριά για να χρησιμοποιήσει το κανόνι. Αλλά είσαι πολύ αδύνατος για να επιβιώσεις μία σύγκρουση. Κολύμπησε προς το μέρος του αντιπάλου ενώ η οριζόντια τοποθεσία είναι μικρότερη από 50. Μετά 'stop' και χρησιμοποίησε το κανόνι.","Pond.helpText6":"Αυτός ο αντίπαλος απομακρύνεται όταν τον χτυπάς. Κολύμπα προς το μέρος του αν είναι εκτός βεληνεκούς (70 μέτρα)."}
